import Link from "next/link";

const Navbar = () => (
  <nav className="navbar">
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>
      <li>
        <Link href="/portfolio">
          <a>Portfolio</a>
        </Link>
      </li>
      <li>
        <Link href="/contact">
          <a>Contact</a>
        </Link>
      </li>
      <li>
        <Link href="blog">
          <a>Blog</a>
        </Link>
      </li>
    </ul>
    <style jsx>{`
      .navbar {
        height: 5%;
        float: right;
      }

      .navbar ul {
        list-style: none;
        padding: 0px;
        background-color:cyan;

      }

      .navbar li {
        padding: 5px;
        display: inline;
      }

      .navbar a {
        letter-spacing:3px;
        color: black;
        text-decoration: none;
        font-weight: bold;
        font-size: 26px;
        padding-right: 15px;
      }

      .navbar a:hover {
        color: red;
      }
    `}</style>
  </nav>
);

export default Navbar;
